import React from 'react'

import Card from './Card'

import './CardRow.css'


const CardRow = ({ cardsData }) => {

    return (
        <div className='cardrow'>

            {
                cardsData.map( (cardData) => (
                    <Card icon={cardData.icon} title={cardData.title} value={cardData.value} />
                ))
            }

        </div>
    )
}


export default CardRow
